(8, 'Registration Confirmation', 'Welcome to NSIGN', '<h1 style=\"text-align: center;\"><span style=\"color: #000000;\">Welcome to NSIGN!</span></h1>\r\n<p><br />Hi {name},<br />Thank you for signing up! We are excited to have you onboard. <br /><br />Feel Free to contact us for any help<br />support@nsign.com<br /><br /><a href=\"http://utilityitsolutions.com/wp/nsign/login\" target=\"_blank\" rel=\"noopener\"><strong style=\"font-family: arial,sans-serif;\">Click here to Login</strong></a></p>', '', NULL, NULL, '', 0, 0, '2019-01-08 03:27:17', '2019-07-28 08:13:36'),
(12, 'Forgot Password', 'Forgot Password - NSIGN', '<h1 style=\"text-align: center;\"><span style=\"color: #337ab7;\">Forgot Password</span></h1>\r\n<h3>&nbsp;</h3>\r\n<p>Hello {name},</p>\r\n<p>It looks like you requested a new password.</p>\r\n<p>If that sounds right, you can enter the new password by clicking on the below link.</p>\r\n<p>Link : <a href=\"http://utilityitsolutions.com/wp/nsign/reset_password/{link}\" target=\"_blank\" rel=\"noopener\">{link}</a></p>', '', NULL, NULL, '', 0, 0, '2019-01-23 04:56:59', '2019-07-28 08:16:09'),
(14, 'Order place', 'Order place', '<p>Hi {name},</p>\r\n<p>Your order has been placed successfully.</p>\r\n<p>&nbsp;</p>\r\n<p>Thank you,</p>', '', NULL, NULL, '', 0, 0, '2019-01-25 01:24:51', '2019-07-28 08:37:53');
