INSERT INTO `page_templates` (`id`, `template_name`, `template_body`, `template_page_enable`, `template_created`, `template_updated`) VALUES
(1, 'About Us', '<p>N Sign Ltd is a rapidly expanding signage and engraving company established in 2000. We are able to offer a wide range of different signage and engraving solutions.</p>\r\n<p>In 2007, N Sign took over Stockton Engraving Company and moved its premises from Middlesbrough to Stockton. We have since relocated again, moving into the former Portrack Conservative Club, a 10,000sq ft premises on Maritime Road, Stockton.</p>\r\n<p>The business&rsquo; diverse signage portfolio includes work such as shop fronts and site signs, through to vehicle graphics and wraps. We offer a complete service from initial site survey through to design, manufacture and installation.</p>\r\n<p>In 2006 N Sign moved away from the traditional steel street nameplate when they developed their own a unique recycled and recyclable polycarbonate street nameplate. These are supplied to local authorities across the UK, including Darlington, Middlesbrough, Redcar and Cleveland, Hartlepool, Hambleton and Basildon.</p>\r\n<p>The take over of Stockton Engraving in 2007 saw N Sign inherit a well-established team of engravers, experienced in everything from personalized items to industrial engraving. The services include anything from labels and control panels to trophy and gift engraving into a variety of different materials, such as stainless steel, brass, laminate and acrylics.</p>', 0, '2019-04-03 04:18:02', '2019-09-08 07:00:20'),
(2, 'Home Page : Our Street Name Plates', '<p>Our sign trays are made from polycarbonate; the tray is fastened to two stainless steel posts with our vandal proof system. The face panels are reverse lettered on anti-glare polycarbonate, which is fitted into the tray using our own integral clip system and VHB tape.</p>\r\n<p>&nbsp;</p>\r\n<p>The plates have been tested in high vandalism areas and we have &lsquo;put it through the mill&rsquo; and have had no problems. We can also produce any logo on our plates (for example council emblem). The signs are available at 1120 x 150mm and 1120 x 285mm. </p>', 0, '2019-04-03 04:18:10', '2019-09-24 09:18:40'),
(3, 'Home Page : About Us', '<div class=\"row\">\r\n<div class=\"col-sm-8\">\r\n<p>At N-Sign Ltd we manufacture street nameplates to any local authority specification, although we have our standard format that covers the majority of local authorities. Our service offers both wall mounted plates and free-standing plates. We also produce other signs at our factory (such as road signage, and site signs) we have geared our production for street nameplates</p>\r\n</div>\r\n<div class=\"col-sm-4\"><img class=\"img-responsive\" src=\"http://utilityitsolutions.com/wp/nsign/assets/frontend/images/image-11.jpg\" alt=\"\" /></div>\r\n</div>', 0, '2019-04-03 04:18:10', '2019-09-24 09:20:18'),
(4, 'Terms & Conditions', '<p>The following terms and conditions apply to all transactions on\" N Sign \" The use of this site indicates your acceptance of these terms and conditions. The placement of an order indicates your acceptance of these terms and conditions. Please read them carefully and print a copy for future reference. These terms and conditions do not affect your statutory rights. We will treat each order for goods as an offer by you to purchase the goods subject to these terms and conditions.</p>\r\n<p><br /><br /></p>\r\n<h4>General:</h4>\r\n<p>You will own the goods once we have received your payment in full. We do not offer any credit facilities. We will issue you with an invoice once your product is ordered. Failure by us to enforce any of these terms and conditions will not affect our right to enforce the rest of these terms and conditions. These terms and conditions are subject to change at any time without prior notice to you.</p>\r\n<p><br /><br /></p>\r\n<h4>Product Information:</h4>\r\n<p>All product specifications, images and other information published on our website have been provided by Trophy Superstore. All information on the website should be as accurate and up to date as possible. However, Trophy Superstore cannot guarantee the reliability or the accuracy of the information contained within its pages. All the actions taken by the user of the website are the responsibility of the individual.</p>\r\n<p><br /><br /></p>\r\n<h4>Payment &amp; Prices:</h4>\r\n<p>The total price payable for the goods will be stipulated at the time when you place your order whether or not the order has been confirmed.</p>\r\n<p>We are entitled to make adjustments to the price to take account of any increase in our supplier\'s prices, or the imposition of any taxes or duties, or if due to an error or omission the price published for the goods is wrong whether or not the order has been confirmed.</p>\r\n<p>We will inform you of the correct price and give you the opportunity to cancel the order. All prices on our website are inclusive of VAT but do not include delivery charges. Delivery charges will be displayed and payable as indicated at the time of placing your order.</p>\r\n<p><br /><strong>Typographical Errors:</strong></p>\r\n<p><em>Engraving Only</em> - Engraving on previously bought products starts at a minimum of &pound;5.00</p>\r\n<p>Characters maximum amount</p>\r\n<p>Fonts</p>\r\n<p>Font Size</p>\r\n<p>&nbsp;</p>\r\n<p>If you choose to personalize or engrave your product we do not change or edit your personalized description, You are responsible to check your own spellings and grammar. You also need to make sure that your message has below the set amount of characters or parts of your message could be lost.</p>\r\n<p><br /><br /><strong>Payment Methods:</strong></p>\r\n<p>You can pay for your purchases</p>\r\n<p>In-store cash or card.</p>\r\n<p>Online purchases can be paid with:</p>\r\n<p>all credit and debit cards displaying the Visa cards</p>\r\n<p>We accept payments via PayPal.</p>\r\n<p><br /><br /></p>\r\n<h4>Delivery:</h4>\r\n<p>Prices start can start from &pound;12, This can change depending on how many products you buy. for free delivery you spend over &pound;100, however, you can always come in to store and collect your products for free.</p>\r\n<p><br /><br /></p>\r\n<h4>Risk:</h4>\r\n<p>From the time of dispatch of the goods, any loss or damage to the goods shall be at your own risk.</p>\r\n<p><br /><br /></p>\r\n<h4>Time Limitation for Notifications of Claims:</h4>\r\n<p>Incorrect Goods: It is your responsibility to notify us of any incorrect goods supplied within 7 days from delivery/purchase.</p>\r\n<p><em>Non-Deliveries:</em> We will not accept liability for goods lost in transit unless we are notified within 10 days from the expected delivery date.</p>\r\n<p><br /><br /></p>\r\n<h4>Cancellation of Orders &amp; Returned Goods:</h4>\r\n<p>If you are not totally satisfied with your purchase for any reason you have the right to cancel your order within 14 working days, starting from the date after the day of purchase, for credit or refund.</p>\r\n<p><br />It is your responsibility to return purchases in pristine condition in its original box and packaging. For full details of how to return please call us on 01642 800222. You will be wholly responsible for the cost of return delivery and safe return of the goods. <br />Subject to claim validly and correctly notified in accordance with the Time Limitation for Notification of Claim paragraph of these terms, goods received back incomplete or in a damaged or used condition will either be returned to you and the cost of delivery charged to your account or we reserve the right to levy a surcharge on such returned goods at a minimum 15% of the invoice price. <br />If you do not return goods within 7 days after you have informed us that you wish to cancel your order, we reserve the right to arrange collection of the item from you and to charge you for such collection. <br /><br />For faulty or damaged goods you have up to 30 days. For full details of how to arrange a faulty or damaged item return please call us on <strong>01642 800222.</strong> <br /><br /><br /></p>\r\n<h4>Contact Information:</h4>\r\n<p>&nbsp;</p>\r\n<p><strong>Address:</strong> Sign House, Maritime Road, Stockton-On-Tees, TS18 2EZ</p>\r\n<p><strong> Telephone:</strong> 01642 800222</p>\r\n<p><strong>Email:</strong> info@n-sign.co.uk</p>', 0, '2019-04-03 04:18:10', '2019-06-21 09:57:50'),
(5, 'Contact Us : Call Us', '<p><a href=\"telto:01642 800 222\">Phone: 01642800222</a></p>\r\n<p><a href=\"mailto:enquiries@n-sign.co.uk\">Email: info@n-sign.co.uk</a></p>\r\n<p>&nbsp;</p>', 0, '2019-04-03 04:18:10', '2019-09-08 07:00:29'),
(6, 'Contact Us : Our Location', '<p>Sign House, Maritime Road,<br />Stockton-On-Tees TS18 2EZ</p>', 0, '2019-04-03 04:18:10', '2019-06-21 10:29:07'),
(7, 'Footer : Contact Us', '<p>N-Sign, Sign House, Maritime Road, Stockton-On-Tees, TS18 2EZ.</p>\r\n<p><a href=\"tel:01642 800 222\">01642 800222</a><br /><a href=\"mailto:enquiries@n-sign.co.uk\">enquiries@n-sign.co.uk</a> <a href=\"mailto:enquiries@n-sign.co.uk\">demo@n-sign.co.uk</a></p>', 0, '2019-04-03 04:18:10', '2019-09-08 07:00:55'),
(8, 'Footer : N Sign Trading Ltd', '<p>Mark a special occasion with a trophy.</p>\r\n<p>Buy trophies at competitive prices at: <a href=\"http://www.n-sign.co.uk/\">n-sign.co.uk</a></p>\r\n<p>Signs, Enraving, vehicle graphics</p>', 0, '2019-04-03 04:18:10', '2019-09-24 09:15:22');
